import React from "react";
import Articles from "./Articles";

class Novels extends React.Component {

    state = {
        datum: []
    }

    renderData(){
        if(this.props.novs.length != 0){
            const arts = this.props.novs.map((item, i) => {
                return <div key={i}> {item.title} </div>
            });
            return arts;
        }

    }

    componentDidUpdate(prevProps){
        if(prevProps.novs != this.props.novs){
            this.setState({datum: this.props.novs})
        }
    }

    render() {
        // this.getFeeds().then(links => {console.log(links)})



        return (
            <div className="novelsMain">
                <h4>yo</h4>
                {this.state.datum.map((item, i) => {
                return <div key={i}> {item.title} </div>
            })}
                <Articles />
            </div>
        );
    }
}
export default Novels;
